import React from 'react';
import 
{ LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend} 
from 'recharts';
import 
{Radar, RadarChart, PolarGrid, PolarAngleAxis, PolarRadiusAxis,} 
from 'recharts';
import data_Chart from './Story_Book_Data'
import data_Radar from './StoryBookRadarData'
export default {
  title: 'Widgets',
};
export const widget1 = () => (
              <div className="Widget-1">
            <h3>Widget 1 : Most Visited...</h3>
            </div>
);
export const widget2 = () => {
  
};
export const widget3 = () => {
  
};
export const widget4 = () => {
  
};
export const chart = () => (
<LineChart
    width={700}
    height={400}
  
    data={data_Chart}
    margin={{ top: 5, right: 30, left: 20, bottom: 5,}}>
    <CartesianGrid strokeDasharray="3 3" />
    <XAxis dataKey="name" />
    <YAxis />
    <Tooltip />
    <Legend />
    <Line type="monotone" dataKey="pv" stroke="#8884d8" activeDot={{ r: 8 }} />
    <Line type="monotone" dataKey="uv" stroke="#82ca9d" />
</LineChart>
);
export const radar = () => (
      <RadarChart cx={250} 
                  cy={190} 
                  outerRadius={150} 
                  width={500} 
                  height={390} 
                  data={data_Radar}
                  >
        <PolarGrid />
        <PolarAngleAxis dataKey="subject" />
        <PolarRadiusAxis />
        <Radar name="Mike" dataKey="A" stroke="#111111" fill="#8884d8" fillOpacity={0.7} />
      </RadarChart>
);
